		Boolean anActualResult = anOutputComponents[3].toLowerCase().matches("true\n*?");
		boolean aReturnValue = aResult.equals(anActualResult);
		if (!aReturnValue) {
			Tracer.info("Expected result:" + aResult + " not equal to actual result:" + anActualResult);

		}
		return aReturnValue;
